  true,\n\t\"url\": null,\n\t\"notes\": \"<p>ZFIN serves as the zebrafish model organism
  database. It aims to: a) be the community database resource for the laboratory use
  of zebrafish, b) develop and support integrated zebrafish genetic, genomic and developmental
  information, c) maintain the definitive reference data sets of zebrafish research
  information, d) to link this information extensively to corresponding data in other
  model organism and human databases, e) facilitate the use of zebrafish as a model
  for human biology, and f) serve the needs of the research community.</p>n\",\n\t\"license_title\":
